import React, { Component } from "react";

import {
    Collapse,
    Navbar,
    NavbarToggler,
    NavbarBrand,
    Nav,
    NavItem,
    NavLink,
    Container
} from "reactstrap";

class NavBar extends Component {
    state={
        isOpen:false
    }

    toggle = () => {
        this.setState({
            isOpen: !this.state.isOpen
        })
    }

    render(){
        return(
            <div>
                <Navbar dark expand="lg" color="dark" className="mb-5 navigationBar">
                    <NavbarBrand href="/">
                        <h3 className="BrandNav">
                            Money Manager
                        </h3>
                    </NavbarBrand>
                </Navbar>
            </div>
        )
    }
}

export default NavBar;
